description:
The Secretary (Nica Noelle, Sweet Sinner / 2014)

Beautiful receptionist Kristina Rose is tired of answering phones - and of being overlooked by hot young attorney Danny Mountain. When she finds out Danny needs a new assistant, Kristina bribes sexually frustrated boss Randy Spears into giving her the job. As the work-obsessed Danny continues to ignore her, an increasingly psychotic Kristina decides to pull out all the stops to get her man. A twisted tale of lust and desire that spins dangerously out of control.

Kristina Rose, Zoe Voss, Randy Spears, Danny Mountain, Rocco Reed

Feature, Couples

